import { config } from "../Constants";
import { authHeader } from "../Utils/auth-header";

const getAllTransacations = () => {
  const headers = authHeader();
  const requestOptions = {
    method: "GET",
    headers,
  };
  return window
    .fetch(`${config.BASE_URL}/mock-tests`, requestOptions)
    .then(handleResponse)
    .then((data) => {
      return data.success.payload1;
    });
};

const addTransacations = (transaction) => {
  const headers = authHeader();
  const requestOptions = {
    method: "POST",
    headers,
    body: JSON.stringify(transaction),
  };
  return window
    .fetch(`http://localhost:3001/v1/transaction`, requestOptions)
    .then(handleResponse)
    .then((data) => {
      return data.success.payload1;
    });
};

function handleResponse(response) {
  return response.text().then((text) => {
    const data = text && JSON.parse(text);
    return data;
  });
}

export const transactionServ = {
  getAllTransacations,
  addTransacations,
};
